func addBase64Icon(dc *gg.Context, base64Data string, centerX, centerY float64) {
	centerX = centerX - 20
	centerY = centerY - 20
	// 1.  Base64     ([]byte)
	decodedBytes, decodeErr := base64.StdEncoding.DecodeString(base64Data)
	if decodeErr != nil {
		fmt.Println("Error decoding Base64 data:", decodeErr)
		return
	}

	// 2.       
	reader := bytes.NewReader(decodedBytes)
	img, _, err := image.Decode(reader)
	if err != nil {
		//    ,     
		//   (, -  Base64 ).
		fmt.Println("Error decoding image from bytes:", err)
		return
	}

	// 3.    
	//    ,     
	const targetSize = 50
	img = resize.Resize(targetSize, targetSize, img, resize.Lanczos3)

	// 4.    ()

	//    (270 / 3 = 90)
	radius := 270 / 3

	//   
	dc.ResetClip()

	//    
	dc.DrawCircle(centerX, centerY, float64(radius))

	//        
	dc.Clip()

	//  ,  
	dc.DrawImageAnchored(img, int(centerX), int(centerY), 0.5, 0.5)

	// :  ,     
	dc.ResetClip()
}
